import React from "react";

function Icon(props) {
  let style = {
    color: props.color,
  };
  let classes = [props.classes, "my-tooltip"].join(" ");
  return (
    <span className={classes} style={style}>
      <i className={props.typeIcon}>
        <span className="my-tooltiptext">{props.toolTipText}</span>
      </i>
    </span>
  );
}

export default Icon;
